from django.db import modelsfrom apps.account.models import Account, PatientModelfrom apps.logus.models import TariffModel, RoomTypeModel, RoomPrice, RoomModelclass BookedRoomModel(models.Model):    room_price = models.ForeignKey(RoomPrice, on_delete=models.SET_NULL, null=True)    room = models.ForeignKey(RoomModel, on_delete=models.SET_NULL, null=True)    patients = models.ForeignKey(PatientModel, on_delete=models.SET_NULL, null=True)    discount = models.IntegerField(default=0)    abs_price = models.BigIntegerField(default=0)    is_checked_out = models.BooleanField(default=False)    start_date = models.DateField()    end_date = models.DateField()    created_by = models.ForeignKey(Account, related_name="booked_room", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_booked_room", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.room} - {self.patients}" # - {self.room_price.tariff}"    @property    def duration(self):        if self.start_date and self.end_date:            duration = self.end_date - self.start_date            return duration.days        else:            return None